<div class="entities" style="line-height: 2.5; direction: ltr">[ Treatment of renal vein thromboses in the newborn ] . Surgical thrombectomy is not a rational approach to neonatal renal vein thrombosis since the occlusion mainly involves intrarenal branches rather than the main renal vein , which is even patent in some instances . Conservative management combines supportive therapy for renal failure and systemic hypertension , if needed , and either heparin or thrombolytic agents . DB00086 has proven difficult to handle in neonates and should not be used .

 has been used in 18 patients but results are difficult to interpret because these cases occurred over an 18 - year period .

<h2 style="margin: 0">28</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Emodin upregulates urokinase plasminogen activator , plasminogen activator inhibitor - 1 and promotes wound healing in human fibroblasts . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00013
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 plasminogen activator ( uPA ) system is important for several biological processes that call for extracellular proteolysis , fibrinolysis , cell migration , proliferation and angiogenesis . The current study highlights the fibrinolytic and wound healing potential of emodin , an anthraquinone , with relevance to the uPA system . Emodin increased the fibrinolytic activity of fibroblast cells in a dose-dependent manner . Zymography linked the activity to increased uPA activity . Subsequent RT-PCR and western analyses demonstrated uPA gene upregulation . Interestingly , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05121
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , the inhibitor of uPA was also upregulated . EMSA showed the upregulation occurred independent of emodin ' s effect on nuclear factor kappa B ( NFkappaB ) . The effect on uPA system is supposedly via generation of reactive oxygen species ( ROS ) since cotreatment with ascorbic acid , an anti-oxidant , attenuated the activity . In addition to profibrinolytic potential , emodin also demonstrated wound healing activity in in vitro wound models . Presence of emodin in the medium enhanced the rate of migration of fibroblasts into the wounded region . These in vitro experiments reveal that emodin is a potent profibrinolytic and wound healing agent .</div>

 and tissue-type plasminogen activators ( u-PA and t-PA ) were identified immunohistochemically in normal and inflamed human appendices by means of polyclonal and monoclonal antibodies . In addition , extracts of the tissues were analyzed for u-PA and t-PA by ELISA . Twelve appendices ( five normal and seven with acute inflammation ) were analyzed . In the normal appendices , there was a strong staining of the endothelial cells for t-PA , whereas there was negative staining for u-PA . In contrast , the endothelial cells in the inflamed appendices showed u-PA immunoreactivity , and negative or very weak reactions for t-PA . In the inflamed appendix , there was also a labeling of u-PA in fibroblast-like cells and in interstitial areas . The specificity of the staining was supported by a variety of staining controls and also by analysis of tissue extracts with ELISA , showing that on the average the inflamed appendices contained more than twice as much mu-PA per mg of protein as the normal appendices and less than one third of the amount of t-PA .</div>

</mark>
 ) inhibitor , captopril , in addition to previous antihypertensive treatment with one or more drugs . Blood pressure control tended to improve on captopril ( systolic pressures 152 + / - 13 vs 140 + / - 13 mm Hg , P &lt; 0.05 ; diastolic pressures 89 + / - 10 vs 87 + / - 10 mm Hg , not significant ) . Proteinuria ( &gt; 0.5 g / 24 hours ) fell into the microalbuminuria range ( albumin excretion 2-20 mg / mmol creatinine ) in four out of 13 patients , and microalbuminuria disappeared in four out of ten patients . Urinary levels of the brush border enzyme O60502 ( NAG ) , a marker of tubular dysfunction , were initially raised and fell significantly after 8 months ' treatment with captopril ( 20.3 + / - 14.4 vs 8.8 + / - 8.1 U / g creatinine ; P &lt; 0.01 ) .

 ) coordinate a plasmin-mediated proteolytic cascade that has been implicated in cell adhesion , cell motility , and matrix breakdown , for example , during inflammation . As part of their function during inflammatory responses , macrophages move through tissues and encounter both two-dimensional ( 2D ) surfaces and more complex three-dimensional ( 3D ) interstitial matrices . Based on approaches employing uPA gene-deficient macrophages , plasminogen supplementation , and neutralization with specific protease inhibitors , it is reported in this study that uPA activity is a central component of the invasion of macrophages through a 3D Matrigel barrier ; it also has a nonredundant role in macrophage-mediated matrix degradation . For murine macrophages , matrix metalloproteinase - 9 activity was found to be required for these uPA-mediated effects . Evidence for a unique role for uPA in the inverse relationship between macrophage adhesion and 2D migration was also noted : macrophage adhesion to vitronectin was enhanced by uPA and blocked by plasminogen activator inhibitor - 1 , the latter approach also able to enhance in turn the 2D migration on this matrix protein . It is therefore proposed that uPA can have a key role in the inflammatory response at several levels as a central regulator of macrophage 3D invasion , matrix remodeling , and adhesion .</div>

<h2 style="margin: 0">60</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Restoration of flow following haemodialysis catheter thrombus . Analysis of rt-PA infusion in tunnelled dialysis catheters . PROBLEM : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00013
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is safe and effective ( &gt; 70 % efficacy for catheter installation ) and that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00750
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ( rt-PA ) can achieve as much as 98 % success . OBJECTIVE : To describe our experience with and our protocol for the use of rt-PA as an alternative agent for catheter thrombolysis . DESIGN : Investigation of a cohort of haemodialysis patients with tunnelled central venous catheter ( SPCVC ) placed between December 2001 to August 2003 and who developed catheter thrombus ( female , n = 8 : male , n = 12 ) . Each patient was given an infusion of between 1 and 2 mg rt-PA / h for 4 h . The dose was dependent on partial or total line obstruction . The technical success of rt-PA is defined as returning catheter blood flow to &gt; 250 mL / min for a 4 - h period . FINDINGS : Twenty patients required 57 infusions in 38 lumens between 01/01 / 02 to 01/09 / 03 . For completely blocked lines rt-PA was infused at 2 mg / h for 4 h achieving 85 % success rate . For inadequate flow ( &lt; 250 mL / min ) rt-PA was infused at 1 mg / h for 4 h achieving an 88 % success rate . CONCLUSION : Rt-PA administered at 2 mg / h for blocked lines effectively restores haemodialysis catheter patency , and at 1 mg / h for sluggish lines is also effective in restoring blood flow through catheters .</div>

 ) is known to be involved in conversion of plasminogen into plasmin and its expression can be regulated by a variety of biological agents including transforming growth factor beta ( TGF-beta ) . In the present study , we cloned the promoter region of the human

 ( huPAR ) gene ( - 653 to + 61 ) and investigated the transcription regulatory mechanism of the expression of the huPAR gene upon treatment with TGF-beta in human monocyte-like U937 cells . By deletion and point mutational analysis of the huPAR gene promoter , it was found that the sequence positioned at - 70 is required for both constitutive and TGF-beta-inducible expression of the huPAR gene in U937 cells . Using electrophoretic mobility shift assay , we could observe that Sp1 formed a DNA-protein complex at the - 70 sequence . In addition , antisense oligonucleotide against human Sp1 blocked both constitutive and TGF-beta-inducible expression of the luciferase reporter gene driven by the huPAR gene promoter in U937 cells . These results led us to conclude that Sp1 transcription factor mediates constitutive and TGF-beta-inducible expression of the huPAR gene in U937 cells through binding to the sequence located at - 70 .</div>
